import '../Components/MovieBox.css'

const MovieBox = ({list,vote_average,title,release_date}) => {
    return (
        <div className="MovieBox">
            <img src={`https://image.tmdb.org/t/p/w200/${list && list.poster_path }`} alt={`${list && list.title && vote_average && title && release_date } Poster`} />
            <h1>{title}</h1>
            <span>{release_date}</span>
            hello

        </div>


    )
}

export default MovieBox
